// Importando o React
import React, { Component } from "react";
// Importando os components necessários da lib react-materialize
import { Row, Table} from 'react-materialize';

//const Tbl = () => (
class Tbl extends Component {  



  render (){
    return (
      <Row>
        <Table className="highlight centered">
            <thead>
              <tr>
                  <th>Data</th>
                  <th>Valor</th>
                  <th>Excluir</th>
              </tr>
            </thead>

            <tbody>
              {investments.map((invest) => (
                <tr >
                  <td>{invest.date}</td>
                  <td>{invest.value}</td>
                  <td><a href="/">X</a></td>
                </tr>
              ))}
            </tbody>
        </Table>
      </Row>
    );
  }
}
//)
export default Tbl;
